import { Link } from "react-router-dom";

const MainNavigation = () => {
  return (
    <head>
      <ul>
        <li>
          <nav>
            <Link to="/">Home</Link>
          </nav>
        </li>
        <li>
          <nav>
            <Link to="/products">Products</Link>
          </nav>
        </li>
      </ul>
    </head>
  );
};

export default MainNavigation;
